INSERT INTO `awards` (`id`, `sector_id`, `award_program_id`, `name`, `description`, `criteria`, `has_nominees`, `created_at`, `updated_at`) VALUES
(101, 26, 2, 'Special Recognition Award for Governor(s) Supporting GRC & Anti-FinCrime Initiatives ', 'Leadership Award for supporting and promoting these initiatives by demonstration of exemplary leadership, implementing effective Governance, Anti-FinCrime / AML and complying with statutory laws, regulations and standards in the Country.', 'Leadership Award for supporting and promoting these initiatives by demonstration of exemplary leadership, implementing effective Governance, Anti-FinCrime / AML and complying with statutory laws, regulations and standards in the Country.', 0, '2023-07-13 00:09:19', NULL),
(102, 27, 2, 'ESG initiatve of the year ', 'Increasingly compliance teams are thinking ahead and integrating ESG compliance requirements into their frameworks and programmes. In this new and emerging field, this category will recognise initiatives that aim to overcome ESG-related challenges or meet ESG-related objectives.', 'This award is open to all internal compliance teams working outside of the financial services sector. \r\n \r\nEntries must demonstrate evidence from the last 12 months, up to the awards entry deadline.\r\n \r\nWe welcome entries from teams operating within Nigeria.\r\n\r\nThe judging panel will consider how innovative approaches and technologies were used, the extent of international and local market collaboration involved, and how the initiative served to address common industry challenges related to ESG-related requirements or expectations. Judges will review projects that relate to all elements of Environmental, Social and Governance, -  or one focused area as applicable. ', 0, '2023-07-13 00:36:41', NULL),
(100, 24, 2, 'GRC & Anti-FinCrime Reporter of the Year', 'This award is to recognise the media for helping to promote GRC & Anti-FinCrime. ', 'Nigerian V programme/channel/Reporter that gives updates and analysis on GRC and Anti-FinCrime matters as well as current happening with the main goal to keep public updated. ', 0, '2023-07-13 00:09:19', NULL),
(99, 23, 2, 'Financial Crime Prevention Woman of the Year', 'The Financial Crime Prevention Woman of the Year Award will recognise an individual working within an organisation that goes above and beyond to ensure anti-financial crime measures and implementation is at the forefront of the day-to-day running of the business and providing exemplary leadership not only at place or employment as well as in the professional community and Nigeria. ', 'Evidence that individual has been successful in leading his/her team , Leader / Champion of Anti-Financial Crime Initiatives in organisation or in professional community promoting innovative solutions, whilst ensuring that your business is complying with the ever-changing landscape when it comes to compliance. The Financial Crime Prevention Woman of the Year Award will recognise an individual working within an organisation that goes above and beyond to ensure anti-financial crime initiatives is at the forefront of the day-to-day running of the business and providing exemplary leadership not only at place or employment as well as in the professional community and Nigeria.', 0, NULL, NULL),
(98, 22, 2, 'GRC Woman of the Year (Financial Sector / Industry)', 'The Financial Crime Prevention Woman of the Year Award will recognise an individual working within an organisation that goes above and beyond to ensure anti-financial crime measures and implementation is at the forefront of the day-to-day running of the business and providing exemplary leadership not only at place or employment as well as in the professional community and Nigeria. ', 'Evidence that individual has been successful in leading his/her team , Champion of Risk & Compliance ethics and Conduct at organisation or in professional community promoting innovative solutions, whilst ensuring that your business is complying with the ever-changing landscape when it comes to compliance. The GRC Woman of the Year Award will recognise an individual working within an organisation that goes above and beyond to ensure compliance is at the forefront of the day-to-day running of the business and providing exemplary leadership not only at place or employment as well as in the professional community and Nigeria. ', 0, '2023-07-13 00:04:45', NULL),
(97, 25, 2, 'Best GRC & FinCrime Prevention Solution Provider of the Year', 'The award recognise indegenious GRC software with latest technologies that\'s robust with all encompassing frameworks (enterprise risk / compliance and governance) capable to improving efficiency, reporting and meets global technology standards.\r\nIt also recognises Financial Crime Prevention Solution Providers that are doing the most to help identify or minimize financial crime activities in the financial industry.\r\nThe award recognises Financial Crime Prevention Solution Providers who are outstanding in the areas of service, negotiation, product impact, conflict resolution, strategy and innovation from the software users’ point of view.', 'A GRC & Fincrime prevention solution provider that its technology enhances , improved controls , reliable , trusted security with sizeable number of existing clients , gained industry acceptance or recognition from the regulatory or professional bodies locally or internationally. Must have recognised industry certifications such as ISO , ICO,  GDPR etc  ', 1, NULL, NULL),
(96, 25, 2, 'Best GRC & Financial Crime Prevention Recruitment & Talents Firm', 'The Award recognises Recruitment firms in the recruiting talents in area of GRC & Financial Crime Prevention who are very versatile and have innovative ways of discovering best / rescourceful talents / candidates', 'A GRC & Financial Crime Prevention Recruitment firms - recruiting talents in area of GRC & Financial Crime Prevention who are very versatile and have innovative ways of discovering best / rescourceful talents / candidates', 1, NULL, NULL),
(95, 25, 2, 'Best GRC & Financial Crime Prevention Advisory Service', 'The award recognises Consultancy / Advisory Service Providers in the area of Governance, Risk and Compliance & Financial Crime Prevention who are very versatile and have innovative ways promoting global best practices and standards across related policies , frameworks , controls in organisations.', 'A GRC & Financial Crime Prevention Advisory Servicea that is very versatile , robust , efficient and has evidence of innovative ways of implementation and execution of statutory requirement , laws and regulations.', 1, NULL, NULL),
(40, 13, 2, 'Internal Controller of the Year', 'This Award is presented to the organisation that has proven itself to be able to lead ground-breaking Risk Management and Compliance approach that tackles the challenges and that has invented and implemented new, innovative ways to learn Risk Management and Compliance in today’s world.', 'Evidence of success in delivering superior values to your clients and organisation through integrated Risk Management and Compliance.\n\nThis award is open to all internal compliance teams working in the financial services sector in Nigeria. \n \nEntries must demonstrate evidence from the last 12 months, up to the awards entry deadline.\n \nWe welcome entries from teams operating within Nigeria Only.\n\nJudges will be looking for participant has responded to external and internal challenges in the last 12 months ahead of the entry deadline, with evidence to support how they’ve built a culture of risk & compliance within their organisation, elevated the compliance profession, or supported the creation of best practice standards across the broader compliance community.', 1, '2022-10-07 12:57:43', '2022-10-07 12:57:43'),
(41, 13, 2, 'Chief Risk Officer of the Year ', 'The aspects that need to be recognised in this individual include the ability to effectively communicate the importance of Risk Management within the corporate structure, the ability to seek innovative approaches for solving complex problems, and the possession of outstanding leadership skills & ability to help others develop quality Risk Management programs.', 'Evidence that your organisation\'s CRO (Chief Risk Officer) has been successful in communicating the importance of risk management within the corporate structure, successful in using innovative approaches for solving the challenges and problems in implementing risk management and the possession of leadership skills and ability to help the organisation develop quality risk management programs.\n\nThis award is open to all internal compliance teams working in the financial services sector in Nigeria. \n \nEntries must demonstrate evidence from the last 12 months, up to the awards entry deadline.\n \nWe welcome entries from teams operating within Nigeria Only.\n\nJudges will be looking for participant has responded to external and internal challenges in the last 12 months ahead of the entry deadline, with evidence to support how they’ve built a risk management culture within their organisation, elevated the risk management profession, or supported the creation of best practice standards across the broader community.', 1, '2022-10-07 12:57:43', '2022-10-07 12:57:43'),
(42, 13, 2, 'Chief Compliance Officer of the Year', 'The Chief Compliance Officer of the Year Award will recognise an individual working within an organisation that goes above and beyond to ensure compliance is at the forefront of the day-to-day running of the business. ', 'Evidence that your organisation\'s CCO (Chief Compliance Officer) has been successful in leading his/her team using innovative solutions, whilst ensuring that your business is complying with the ever-changing landscape when it comes to compliance.\n\nThis award is open to all internal compliance teams working in the financial services sector in Nigeria. \n \nEntries must demonstrate evidence from the last 12 months, up to the awards entry deadline.\n \nWe welcome entries from teams operating within Nigeria Only.\n\nJudges will be looking for participant has responded to external and internal challenges in the last 12 months ahead of the entry deadline, with evidence to support how they’ve built a culture of compliance within their organisation, elevated the compliance profession, or supported the creation of best practice standards across the broader compliance community.', 1, '2022-10-07 12:57:43', '2022-10-07 12:57:43'),
(43, 13, 2, 'MLRO or Head of Financial Crime Prevention of the Year ', 'An award to acknowledge the efforts of an organisation in the prevention of Fraud in any business or public sector activity.This award recognises the work of a Money Laundering Reporting Officer in a Bank or Head of Anti-Financial Crime in a Bank either through the challenges that they have had to face and mastered or through the actions taken to bring benefit to their organisation or the industry.', 'Evidence that your organisation\'s Money Laundering Reporting Officer or the Head of Anti-Financial Crime has been successful in fighting against Money Laundering by making significant progress in the prevention of illicit monies entering the banking systems.\n\nThis award is open to all internal compliance teams working in the financial services sector in Nigeria. \n \nEntries must demonstrate evidence from the last 12 months, up to the awards entry deadline.\n \nWe welcome entries from teams operating within Nigeria Only.\n\nJudges will be looking for how participant has responded to external and internal challenges in the last 12 months ahead of the entry deadline, with evidence to support how they’ve built a  Fraud Prevention/ Anti-Money Laundering culture within their organisation, elevated the  Fraud Prevention/ Anti-Money Laundering profession, or supported the creation of best practice standards across the broader community.', 1, '2022-10-07 12:57:43', '2022-10-07 12:57:43'),
(44, 13, 2, 'GRC Employer of the Year', 'This award will recognise an organisation that has...', 'Evidence of success in creating and maintaining a supportive working environment that has a real commitment and understanding of its employees. Evidence of a transparent and open culture, with opportunities for learning and progression, the outcome of which will be an engaged, motivated and satisfied workforce. Also, evidence of a good governance structure in place.\n\nThis award is open to all internal compliance teams working in the financial services sector in Nigeria. \n \nEntries must demonstrate evidence from the last 12 months, up to the awards entry deadline.\n \nWe welcome entries from teams operating within Nigeria.\n\nJudges will be looking for how the Organisation has responded to external and internal challenges in the last 12 months ahead of the entry deadline, with evidence to support how they’ve built a culture of compliance within their organisation, elevated the compliance profession, or supported the creation of best practice standards across the broader compliance community.', 1, '2022-10-07 12:57:43', '2022-10-07 12:57:43'),
(45, 13, 2, 'AML Employer of the Year', 'An award to promote the fight against Money Laundering by recognising the efforts of an organisation making significant progress in prevention of illicit monies entering the banking systems. Also, to recognise organisation(s) taking proactive steps to improve their financial crime prevention capability.', 'Please nominate a bank that has successfully created and maintained a supportive working environment that has a real commitment and understanding of its employees. The Bank must have a culture of transparency and openness, with opportunities for learning and progression, the outcome of which will be an engaged, motivated and satisfied workforce.', 1, '2022-10-07 12:57:43', '2022-10-07 12:57:43'),
(46, 14, 2, 'GRC & Financial Crime Prevention Visionary Awards', 'An award to recognise an organisation whose work demonstrates any or all qualities of exceptional foresight, creativity, advocacy, and vision, that furthers the research and development of GRC & FC Prevention capabilities.', 'Evidence of success in demonstrating creativity, advocacy, and vision, that furthers the research and development of GRC & FC Prevention.', 1, '2022-10-07 12:57:43', '2022-10-07 12:57:43'),
