(88, 20, 2, 'GRC Employer of the Year', 'This award will recognise an organisation that has the wellbeing of its employees at its core.', 'Evidence of success in creating and maintaining a supportive working environment that has a real commitment and understanding of its employees. Evidence of a transparent and open culture, with opportunities for learning and progression, the outcome of which will be an engaged, motivated and satisfied workforce. Also, evidence of a good governance structure in place.\r\n\r\nThis award is open to all internal compliance teams working in the financial services sector in Nigeria. \r\n \r\nEntries must demonstrate evidence from the last 12 months, up to the awards entry deadline.\r\n \r\nWe welcome entries from teams operating within Nigeria.\r\n\r\nJudges will be looking for how the Organisation has responded to external and internal challenges in the last 12 months ahead of the entry deadline, with evidence to support how they’ve built a culture of compliance within their organisation, elevated the compliance profession, or supported the creation of best practice standards across the broader compliance community.', 1, '2023-07-12 23:43:26', NULL),
