(86, 20, 2, 'Chief Risk Officer of the Year ', 'The aspects that need to be recognised in this individual include the ability to effectively communicate the importance of Risk Management within the corporate structure, the ability to seek innovative approaches for solving complex problems, and the possession of outstanding leadership skills & ability to help others develop quality Risk Management programs.', 'Evidence that your organisation\'s CRO (Chief Risk Officer) has been successful in communicating the importance of risk management within the corporate structure, successful in using innovative approaches for solving the challenges and problems in implementing risk management and the possession of leadership skills and ability to help the organisation develop quality risk management programs.\r\n\r\nThis award is open to all internal compliance teams working in the financial services sector in Nigeria. \r\n \r\nEntries must demonstrate evidence from the last 12 months, up to the awards entry deadline.\r\n \r\nWe welcome entries from teams operating within Nigeria Only.\r\n\r\nJudges will be looking for participant has responded to external and internal challenges in the last 12 months ahead of the entry deadline, with evidence to support how they’ve built a risk management culture within their organisation, elevated the risk management profession, or supported the creation of best practice standards across the broader community.', 1, '2023-07-12 23:23:14', NULL),
(85, 19, 2, 'AML Employer of the Year', 'An award to promote the fight against Money Laundering by recognising the efforts of an organisation making significant progress in prevention of illicit monies entering the banking systems. Also, to recognise organisation(s) taking proactive steps to improve their financial crime prevention capability.', 'Evidence of success in the prevention of illicit monies entering the banking systems and in taking proactive steps to improve your financial crime prevention capability.\r\n\r\nThis award is open to all internal compliance teams working in the financial services sector in Nigeria. \r\n \r\nEntries must demonstrate evidence from the last 12 months, up to the awards entry deadline.\r\n \r\nWe welcome entries from teams operating within Nigeria Only.\r\n\r\nJudges will be looking for how the Organisation has responded to external and internal challenges in the last 12 months ahead of the entry deadline, with evidence to support how they’ve built a  Fraud Prevention/ Anti-Money Laundering culture within their organisation, elevated the  Fraud Prevention/ Anti-Money Laundering profession, or supported the creation of best practice standards across the broader community.', 1, '0000-00-00 00:00:00', NULL),
(84, 19, 2, 'GRC Employer of the Year', 'This award will recognise an organisation that has the wellbeing of its employees at its core.', 'Evidence of success in creating and maintaining a supportive working environment that has a real commitment and understanding of its employees. Evidence of a transparent and open culture, with opportunities for learning and progression, the outcome of which will be an engaged, motivated and satisfied workforce. Also, evidence of a good governance structure in place.\r\n\r\nThis award is open to all internal compliance teams working in the financial services sector in Nigeria. \r\n \r\nEntries must demonstrate evidence from the last 12 months, up to the awards entry deadline.\r\n \r\nWe welcome entries from teams operating within Nigeria.\r\n\r\nJudges will be looking for how the Organisation has responded to external and internal challenges in the last 12 months ahead of the entry deadline, with evidence to support how they’ve built a culture of compliance within their organisation, elevated the compliance profession, or supported the creation of best practice standards across the broader compliance community.', 1, '2023-07-12 23:01:00', NULL),
(83, 19, 2, 'Chief Compliance Officer of the Year', 'The Chief Compliance Officer of the Year Award will recognise an individual working within an organisation that goes above and beyond to ensure compliance is at the forefront of the day-to-day running of the business. ', 'Evidence that your organisation\'s CCO (Chief Compliance Officer) has been successful in leading his/her team using innovative solutions, whilst ensuring that your business is complying with the ever-changing landscape when it comes to compliance.\r\n\r\nThis award is open to all internal compliance teams working in the financial services sector in Nigeria. \r\n \r\nEntries must demonstrate evidence from the last 12 months, up to the awards entry deadline.\r\n \r\nWe welcome entries from teams operating within Nigeria Only.\r\n\r\nJudges will be looking for participant has responded to external and internal challenges in the last 12 months ahead of the entry deadline, with evidence to support how they’ve built a culture of compliance within their organisation, elevated the compliance profession, or supported the creation of best practice standards across the broader compliance community.', 1, '2023-07-12 22:38:21', NULL);
