INSERT INTO `categories` (`id`, `award_program_id`, `name`, `description`, `is_non_voting_category`, `created_at`, `updated_at`) VALUES
(7, 2, 'GRC & Financial Crime Prevention Excellence Awards', 'These awards recognise organisations that are well into their integrated GRC & Financial Crime Prevention Journey, with a clear integrated GRC & Financial Crime Prevention vision, systems with multiple lines of defense and a high focus on innovation.', 0, '2022-09-28 07:31:30', '2022-09-28 07:31:30'),
(8, 2, 'GRC & Financial Crime Prevention Journey Award', 'This award recognises organisations that have made exceptional progress along their GRC Journey. The recipients have achieved an integrated, high value, and sustainable GRC program.', 0, '2022-09-28 07:31:30', '2022-09-28 07:31:30'),
(9, 2, 'GRC & Financial Crime Service Providers Awards ', 'These awards recognise organisations and individuals that make great strides in embedding governance, risk management, and compliance (GRC) to attain principled performance. The award is given to the organisation that shows the real maturity in transiting to the integration between and across the risk management and compliance areas, making risk-aware decisions, and supporting the overall business performance.', 0, '2022-09-28 07:31:30', '2022-09-28 07:31:30'),
(10, 2, 'Women in GRC & Financial Crime Prevention Awards', 'The Women in Governance, Risk and Compliance Awards honour female leaders demonstrating excellence across GRC. These Awards showcase the role models, advocates and mentors, as well as the inspirational women building and leading in the world of GRC. Please nominate a female leader in any of the Financial Sectors in Nigeria that meets this criteria.', 0, '2022-09-28 07:31:30', '2022-09-28 07:31:30'),
(11, 2, 'GRC & Financial Crime Prevention Promoter Awards', 'These awards are to recognise the media for helping to promote GRC & Financial Crime Prevention.', 0, '2022-09-28 07:31:30', '2022-09-28 07:31:30'),
(12, 2, 'GRC & Financial Crime Prevention Non FI Awards ', 'Increasingly compliance teams are thinking ahead and integrating ESG compliance requirements into their frameworks and programmes. In this new and emerging field, this category will recognise initiatives that aim to overcome ESG-related challenges or meet ESG-related objectives.', 0, '2022-09-28 07:31:30', '2022-09-28 07:31:30'),
(13, 2, 'Special Recognition Awards', 'Leadership Awards for supporting and promoting these initiatives by demonstration of exemplary leadership, implementing effective Governance, Anti-Financial Crime / AML and complying with statutory laws, regulations and standards in their various states (Public sector) in the Country.', 0, '2022-09-28 07:31:30', '2022-09-28 07:31:30');
