(6, 41, 217, NULL, '10', '20.833333333333', 'Gregory Jobome', 'EXECUTIVE DIRECTOR, CHIEF RISK OFFICER', 'https://www.linkedin.com/in/gregory-jobome-522943102/', 'Certified Risk Manager, ISO - International Organization for Standardization. Member, International Association of Risk & Compliance Professionals  Member, Risk Managers Association of Nigeria  Member, Institute of Leadership and Management UK  Member, Royal Economic Society UK  Member, Institute of Directors UK  Member, Institute of Directors Nigeria  Institute of International Finance (organizational membership)  Honorary Senior Member, Chartered Institute of Bankers of Nigeria  Certified Risk Specialist (CRS)  Certified Operational Risk Professional  Certified Risk Manager', 'Four Independent Non-executive Directors', 'Board Risk Management Committee Charter', 'Access Bank (“The Bank”) commits to the campaign against money laundering (ML), financing of terrorism (FT), proliferation financing (PF) and all other forms of financial crimes. As a compliant organization, it continually enforces these principles and ensures that all stakeholders (customers, partners, vendors & third parties, employees, Board and Management, etc.) comply with the same laws in all dealings.  In line with corporate governance and observance of regulatory directives, the Bank has established policies to guide against these financial crimes and requires total compliance from all parties in all its banking subsidiaries (including foreign offices).The objectives of Access Bank AML/CFT/CPF policies are as follows:  To ensure that Access Bank is in full compliance with compliance related laws, regulations and standards To provide clarity on the prevention of money laundering, financing of terrorist groups and prevention of persons and organizations involved in the proliferation of weapons of mass destruction (WMDs) from raising, moving, and using funds through the Bank’s channels. To lay principles for identification of suspicious activities and transactions that may be indicative of money laundering, terrorist financing or proliferation financing and reporting of same to the appropriate authorities. To ensure that Access Bank, its subsidiaries and stakeholders do not become victims of money laundering, terrorist financing and proliferation activities, thereby protecting the reputation of all parties.', 'The AML/CFT/CPF policies of Access Bank are formulated in compliance with the overarching regulations outlined below:  Money Laundering (Prohibition) Act 2022 Proceeds of Crime (Recovery and Management) Act, 2022 Banks and Other Financial Institutions Act 2020 Foreign Exchange Act 1995 Corrupt Practices and Other Related Offences Act 2000 Terrorism (Prevention and Prohibition) Act 2022 Security and Exchange Commission Code of Corporate Governance for Public Companies. CBN Anti-Money Laundering and Combating the Financing of Terrorism (administrative sanctions) regulations, 2018 CBN AML/CFT Regulations 2022 and other extant laws', 'An effective whistle blowing programme has been set up by Access Bank Plc. An effective whistle blowing programme is the ability of customers, suppliers, vendors, employees and other stakeholders to report misconduct discreetly and confidentially if they so desire.', '“Gregory Jobome” + “Fraud” OR “Money Laundering” OR “Fines” OR “Sanctions” OR “Tax Evasion” OR “Pornography” OR “Environment” OR “Health and Safety” OR “Embargo” OR “Rape” OR “Violence” OR “Terrorism” OR “Hostage” OR “Ransom” ”Bankruptcy” OR “Scandal” OR “Penalty” OR “Lawsuit” OR “Conflict” OR “Breach” OR “Conflict” OR “War” OR “Violation” OR “Ammunitions” OR “Embezzlement” OR “Scam” OR “illegal” OR “Human Trafficking” - Google Search', '[\"10\",\"8\",\"7\",\"10\",\"9\"]', '88', '70.4', '7.4074074074074', '77.807407407407', 'WINNER', '2023-09-22 15:20:10', '2023-10-19 03:36:26'),
(7, 41, 222, NULL, '9', '18.75', 'Olumide Oguntuase', 'Head, Enterprise Risk Management Division', 'https://www.linkedin.com/in/olumideoguntuase/', 'Institute of Chartered Accountants of Nigeria', 'Three Independent Non-Executive Directors', 'Enterprise Risk Management Division', 'Guaranty Trust Bank Limited (“the Bank”), is committed to the fight against all forms of financial crime, which includes, money laundering, terrorism financing, Proliferation financing and bribery and corruption. To show this commitment, the Bank has continually implemented a framework for Anti-Money Laundering (“AML”), Combating the Financing of Terrorism (“CFT”) and Combating Proliferation financing (CPF). Strict adherence to this framework is mandatory for all employees.', 'The Bank’s framework ensures compliance with AML/CFT/CPF legislation and regulations in Nigeria and has incorporated leading best practices including, but not limited to:  • The Financial Action Task Force (FATF) 40 Recommendations. • Money Laundering (Prevention and Prohibition) Act, 2022. • Terrorism (Prevention and Prohibition) Act, 2022. • CBN AML/CFT/CPF Regulations, 2022. • Terrorism Prevention Regulations, 2013. • Corrupt Practices and Other Related Offences Act, Cap. C31, Laws of the Federation of Nigeria, 2004 (“the Act”). • UK Bribery Act 2010. • USA Foreign Corrupt Practices Act. • Proceeds of Crimes (Recovery and Management) Act, 2022. • Central Bank of Nigeria (CBN) Circulars.', 'The Ethics Policy and Code of Professional Conduct of the Bank clearly communicates the Bank’s position on bribery and corruption to employees. The Policy and the Code clearly state that all employees and related acquaintances are prohibited from partaking in any form of corrupt engagement.', 'https://www.blueprint.ng/uk-fines-gtb-9-3m-over-weak-money-laundering-control-system     https://nationaldailyng.com/forex-scarcity-more-banks-suspend-foreign-transactions-on-naira-mastercard/     https://www.thecable.ng/stallion-nigeria-refutes-fake-news-over-alleged-debt-to-gtb        https://thenationonlineng.net/stallion-not-indebted-to-gtb/', '[\"7\",\"7\",\"4\",\"7\",\"8\"]', '66', '52.8', '6.6666666666667', '59.466666666667', NULL, '2023-09-22 15:20:10', '2023-10-15 00:12:34'),
(8, 41, 235, NULL, '4', '8.3333333333333', 'Olusegun Alebiosu', 'Executive Director, Chief Risk Officer', 'No Available Information', 'Fellow, Institute of Chartered Accountants (FCA), Associate, Nigeria Institute of Management (ANIM), Chartered Institute of Bankers of Nigeria (CIBN) and Member, Nigeria Institute of International Affairs.', 'Six Independent Non-executive Directors', 'The Board Audit and Risk Assessment Committee (BARAC)', 'FirstBank is committed to conducting business with utmost level of integrity, transparency, and compliance with legal, ethical and regulatory standards. Our reputation and success as an organization is built upon this foundation as we strive to maintain our position as a leading organization both locally and internationally.', 'The Bank\'s Framework comprises of: Review of First Bank\'s Whistle Blowing Policy, Review of First Bank\'s Anti-bribery corruption policy, Review of First Bank\'s Conflict of Interest and Related Party Transactions Policy 2019, Anti-Money Laundering and Combating the Financing of Terrorism  Policy and Procedures Manual, Independent Assessment of the Compliance programme 2018', 'Availability of Pending receipt of satisfactory documents or information from a Customer and/or pending the conclusion of any due diligence activity by or on behalf of the Bank.', 'https://punchng.com/fg-charges-first-bank-md-others-with-forgery/             https://www.politicaleconomistng.com/cbn-sec-fine-first-bank-multiple-fraudulent-dealings/', '[\"6\",\"6\",\"4\",\"5\",\"7\"]', '56', '44.8', '2.962962962963', '47.762962962963', NULL, '2023-09-22 15:20:10', '2023-10-15 00:12:34'),
(9, 41, 227, NULL, '4', '8.3333333333333', 'Olutoye Ambekemo', 'Acting Chief Risk Officer', 'https://www.linkedin.com/in/olutoye-ambekemo-0a2397223/', 'No Available Information', 'Two Independent Non-Executive Directors', 'Directors & Board Audit Committee', 'Sterling Bank has a Whistle Blowing Policy and commitment to accountability and transparency includes an effective whistleblowing mechanism. Employees and the general public can confidently raise concerns, ensuring strong corporate governance and better fraud risk management.', 'This Institution by the provision of the Money Laundering Provisions Act(MLPA) 2011(As Amended) and Terrorism Prevention Act(TPA)2011 as amended is statutorily bound to report: Currency Transaction Report(CTR), Suspicious Transaction Report(STR), Terrorist Financing Activities', 'Availability of Pending receipt of satisfactory documents or information from a Customer and/or pending the conclusion of any due diligence activity by or on behalf of the Bank.', 'https://nairametrics.com/2020/04/22/sterling-bank-attempted-to-scam-its-customers-but-its-a-drill/', '[\"5\",\"6\",\"4\",\"5\",\"7\"]', '54', '43.2', '2.962962962963', '46.162962962963', NULL, '2023-09-22 15:20:10', '2023-10-15 00:12:34'),
