(42, 42, 222, NULL, '8', '16.326530612245', 'Osa Aiwerioghene', 'General Manager - Head, Compliance Group', 'https://www.linkedin.com/in/osa-aiwerioghene-2352832b/', 'No Available Information', 'Three Independent Non-Executive Directors', 'Board Risk Management Committee', 'Guaranty Trust Bank Limited (“the Bank”), is committed to the fight against all forms of financial crime, which includes, money laundering, terrorism financing, Proliferation financing and bribery and corruption. To show this commitment, the Bank has continually implemented a framework for Anti-Money Laundering (“AML”), Combating the Financing of Terrorism (“CFT”) and Combating Proliferation financing (CPF). Strict adherence to this framework is mandatory for all employees.', 'The Bank’s framework ensures compliance with AML/CFT/CPF legislation and regulations in Nigeria and has incorporated leading best practices including, but not limited to:  • The Financial Action Task Force (FATF) 40 Recommendations. • Money Laundering (Prevention and Prohibition) Act, 2022. • Terrorism (Prevention and Prohibition) Act, 2022. • CBN AML/CFT/CPF Regulations, 2022. • Terrorism Prevention Regulations, 2013. • Corrupt Practices and Other Related Offences Act, Cap. C31, Laws of the Federation of Nigeria, 2004 (“the Act”). • UK Bribery Act 2010. • USA Foreign Corrupt Practices Act. • Proceeds of Crimes (Recovery and Management) Act, 2022. • Central Bank of Nigeria (CBN) Circulars.', 'Availability of Pending receipt of satisfactory documents or information from a Customer and/or pending the conclusion of any due diligence activity by or on behalf of the Bank.', 'https://www.blueprint.ng/uk-fines-gtb-9-3m-over-weak-money-laundering-control-system	  https://nationaldailyng.com/forex-scarcity-more-banks-suspend-foreign-transactions-on-naira-mastercard/      https://www.thecable.ng/stallion-nigeria-refutes-fake-news-over-alleged-debt-to-gtb     https://thenationonlineng.net/stallion-not-indebted-to-gtb/', '[\"8\",\"4\",\"6\",\"7\",\"8\"]', '66', '52.8', '6.4', '59.2', NULL, '2023-09-25 21:15:38', '2023-10-15 00:13:16'),
(43, 42, 227, NULL, '6', '12.244897959184', 'Kelechi N.', 'Chief Compliance Officer at Sterling Bank Plc', 'https://www.linkedin.com/in/kelechi-n-986b4618/', 'No Available Information', 'Two Independent Non-Executive Directors', 'The Board Audit and Risk Assessment Committee (BARAC)', 'Sterling Bank has a Whistle Blowing Policy and commitment to accountability and transparency includes an effective whistleblowing mechanism. Employees and the general public can confidently raise concerns, ensuring strong corporate governance and better fraud risk management.', 'This Institution by the provision of the Money Laundering Provisions Act(MLPA) 2011(As Amended) and Terrorism Prevention Act(TPA)2011 as amended is statutorily bound to report: Currency Transaction Report(CTR), Suspicious Transaction Report(STR), Terrorist Financing Activities', 'Availability of Pending receipt of satisfactory documents or information from a Customer and/or pending the conclusion of any due diligence activity by or on behalf of the Bank.', 'https://nairametrics.com/2020/04/22/sterling-bank-attempted-to-scam-its-customers-but-its-a-drill/', '[\"7\",\"6\",\"6\",\"5\",\"7\"]', '62', '49.6', '4.8', '54.4', NULL, '2023-09-25 21:15:38', '2023-10-15 00:13:16'),
(44, 42, 217, NULL, '6', '12.244897959184', 'Femi Jaiyeola', 'Group Chief Conduct & Compliance Officer - Access Bank', 'https://www.linkedin.com/in/femi-jaiyeola-025a142/', 'No Available Information', 'Four Independent Non-executive Directors', 'Board Risk Management Committee Charter', 'Access Bank (“The Bank”) commits to the campaign against money laundering (ML), financing of terrorism (FT), proliferation financing (PF) and all other forms of financial crimes. As a compliant organization, it continually enforces these principles and ensures that all stakeholders (customers, partners, vendors & third parties, employees, Board and Management, etc.) comply with the same laws in all dealings.  In line with corporate governance and observance of regulatory directives, the Bank has established policies to guide against these financial crimes and requires total compliance from all parties in all its banking subsidiaries (including foreign offices).The objectives of Access Bank AML/CFT/CPF policies are as follows:  To ensure that Access Bank is in full compliance with compliance related laws, regulations and standards To provide clarity on the prevention of money laundering, financing of terrorist groups and prevention of persons and organizations involved in the proliferation of weapons of mass d', 'The AML/CFT/CPF policies of Access Bank are formulated in compliance with the overarching regulations outlined below:  Money Laundering (Prohibition) Act 2022 Proceeds of Crime (Recovery and Management) Act, 2022 Banks and Other Financial Institutions Act 2020 Foreign Exchange Act 1995 Corrupt Practices and Other Related Offences Act 2000 Terrorism (Prevention and Prohibition) Act 2022 Security and Exchange Commission Code of Corporate Governance for Public Companies. CBN Anti-Money Laundering and Combating the Financing of Terrorism (administrative sanctions) regulations, 2018 CBN AML/CFT Regulations 2022 and other extant laws', 'Availability of Pending receipt of satisfactory documents or information from a Customer and/or pending the conclusion of any due diligence activity by or on behalf of the Bank.', 'No Adverse media', '[\"9\",\"8\",\"8\",\"5\",\"9\"]', '78', '62.4', '4.8', '67.2', 'WINNER', '2023-09-25 21:15:38', '2023-10-19 03:35:06'),
(45, 42, 233, NULL, '5', '10.204081632653', 'Lawrence Babalola BSc, MBA, FCA, FICA, HCIB', 'Chief Compliance Officer', 'https://www.linkedin.com/in/lawrencebabalola/', 'No Available Information', '5 independent non-executive directors', 'Corporate Governance', 'Code Of Governance The Bank subscribes to the following codes of Corporate Governance:  Central Bank of Nigeria (CBN) Code of Corporate Governance for Banks in Nigeria 2014. www.cbn.gov.ng Securities and Exchange Commission (SEC) Code of Corporate Governance. www.sec.gov.ng Economic and Financial Crimes Commission (EFCC) Establishment Act. www.efccnigeria.org Nigeria Deposit Insurance Corporation (NDIC) Code of Corporate Governance. www.ndic.gov.ng The National Code of Corporate Governance for Public Companies which became effective in January 2019. In addition to the above Codes, the Bank complies with relevant disclosure requirements in other jurisdictions where it operates. During the period under review, the Bank complied with the provisions of the codes.', 'Zenith Bank Plc AML Policy Comprises: (i)General AML Policies, Practices and Procedures, (ii) Risk Assessment (iii)Know Your Customer, Due Diligence (iv) Reportable Transactions and Prevention and Detection of Transactions with Illegally Obtained Funds, (v)Transaction Monitoring', 'Availability of Pending receipt of satisfactory documents or information from a Customer and/or pending the conclusion of any due diligence activity by or on behalf of the Bank.', 'https://fij.ng/article/n800500-is-all-you-can-get-zenith-bank-tells-customer-whose-n4m-was-taken-without-authorisation/       https://bizwatchnigeria.ng/like-gtco-zenith-bank-suspends-dollar-transactions-on-naira-atm-cards/', '[\"6\",\"4\",\"6\",\"5\",\"6\"]', '54', '43.2', '4', '47.2', NULL, '2023-09-25 21:15:38', '2023-10-15 00:13:16');
