(1, 40, 217, NULL, '15', '25.423728813559', 'Four Independent Non-executive Directors', 'At Access Bank, the Board has governance oversight for sustainability management through an established Sustainability Committee, which provides the highest level of governance. The Sustainability Committee is responsible for overseeing the delivery of the Bank’s sustainable business strategy, to ensure the Bank’s sustainability ambitions in each of its strategic priorities are achieved.  Access Bank Plc is committed to implementing the best practice standards of corporate governance for sustainability. The subsidiaries comply with the statutory and regulatory requirements of their host countries and also align their governance framework to the Bank’s governance framework. The Board is responsible for embedding high standards of Sustainability across the Group which is essential for the enterprise.', 'The AML/CFT/CPF policies of Access Bank are formulated in compliance with the overarching regulations outlined below:  Money Laundering (Prohibition) Act 2022  Proceeds of Crime (Recovery and Management) Act, 2022  Banks and Other Financial Institutions Act 2020  Foreign Exchange Act 1995  Corrupt Practices and Other Related Offences Act 2000  Terrorism (Prevention and Prohibition) Act 2022  Security and Exchange Commission Code of Corporate Governance for Public Companies.  CBN Anti-Money Laundering and Combating the Financing of Terrorism (administrative sanctions) regulations, 2018  CBN AML/CFT Regulations 2022 and other extant laws', 'No Adverse media', '[\"8\",\"7\",\"6\",\"5\",\"8\",\"7\",\"5\",\"10\",\"9\",\"6\"]', '71', '56.8', '8.5714285714286', '65.371428571429', 'WINNER', '2023-08-31 03:56:23', '2023-10-19 03:21:41'),
(2, 40, 235, NULL, '7', '11.864406779661', 'Six Independent Non-Executive Directors', 'First Bank’s core value is centered on four culture themes which are; Entrepreneurship, Professionalism, Innovation and Customer – Centricity (EPIC). Being EPIC is how they define their commitment to making things happen. First for each other, then for the bank, and then for everyone. It is how they keep themselves motivated and inspired for another workday. It is how they aspire to be better in our professional and personal lives.', 'FirstBank is committed to conducting business with utmost level of integrity, transparency, and compliance with legal, ethical and regulatory standards. Our reputation and success as an organization is built upon this foundation as we strive to maintain our position as a leading organization both locally and internationally.', 'https://punchng.com/fg-charges-first-bank-md-others-with-forgery/     https://www.politicaleconomistng.com/cbn-sec-fine-first-bank-multiple-fraudulent-dealings/', '[\"6\",\"5\",\"7\",\"7\",\"6\",\"5\",\"8\",\"5\",\"8\",\"5\"]', '62', '49.6', '4', '53.6', NULL, '2023-08-31 03:56:23', '2023-10-17 20:10:19'),
(3, 40, 222, NULL, '7', '11.864406779661', 'Three Independent Non-Executive members', 'Guaranty Trust Bank Limited (“the Bank”), is committed to the fight against all forms of financial crime, which includes, money laundering, terrorism financing, Proliferation financing and bribery and corruption. To show this commitment, the Bank has continually implemented a framework for Anti-Money Laundering (“AML”), Combating the Financing of Terrorism (“CFT”) and Combating Proliferation financing (CPF). Strict adherence to this framework is mandatory for all employees.', 'The Bank’s framework ensures compliance with AML/CFT/CPF legislation and regulations in Nigeria and has incorporated leading best practices including, but not limited to:  • The Financial Action Task Force (FATF) 40 Recommendations. • Money Laundering (Prevention and Prohibition) Act, 2022. • Terrorism (Prevention and Prohibition) Act, 2022. • CBN AML/CFT/CPF Regulations, 2022. • Terrorism Prevention Regulations, 2013. • Corrupt Practices and Other Related Offences Act, Cap. C31, Laws of the Federation of Nigeria, 2004 (“the Act”). • UK Bribery Act 2010. • USA Foreign Corrupt Practices Act. • Proceeds of Crimes (Recovery and Management) Act, 2022. • Central Bank of Nigeria (CBN) Circulars.', 'https://fij.ng/article/gtb-places-restriction-on-customers-accounts-over-n586000-fraud-he-self-reported/       https://www.blueprint.ng/uk-fines-gtb-9-3m-over-weak-money-laundering-control-system      https://nationaldailyng.com/forex-scarcity-more-banks-suspend-foreign-transactions-on-naira-mastercard/      https://www.thecable.ng/stallion-nigeria-refutes-fake-news-over-alleged-debt-to-gtb      https://thenationonlineng.net/stallion-not-indebted-to-gtb/', '[\"6\",\"5\",\"8\",\"7\",\"5\",\"5\",\"9\",\"5\",\"7\",\"7\"]', '64', '51.2', '4', '55.2', NULL, '2023-08-31 03:56:23', '2023-10-17 20:10:19'),
(4, 40, 227, NULL, '6', '10.169491525424', 'Two Independent Non-executive directors', 'At Sterling bank, sustainability is at the core of their strategy and business. They are committed to improving lives, economic development and environment sustainability.', 'Sterling Bank over the years, enriches its Customers lives by engaging in: Economic Investments, Environmental Investments and Social Investments', 'https://nairametrics.com/2020/04/22/sterling-bank-attempted-to-scam-its-customers-but-its-a-drill/', '[\"6\",\"7\",\"8\",\"7\",\"5\",\"5\",\"8\",\"5\",\"8\",\"5\"]', '64', '51.2', '3.4285714285714', '54.628571428571', NULL, '2023-08-31 03:56:23', '2023-10-17 20:10:19'),
