(1, 95, 424, NULL, '8', '29.62962962963', 'At Deloitte, we are driven to help our clients, people and communities thrive. Working with the best of the best, we provide a wide variety of services for a range of industries. Whether we’re helping transform organisations, protecting financial markets, or working with governments to support societies, there is no end to the impact we make each day.    https://www.deloitte.com/ng/en/what-we-do.html?icid=top_what-we-do', 'Digital transformation, Trainings and Corporate social responsibility', 'Mobile Oil Nigeria Plc ·         Mutual Benefits Nigeria Plc ·         Royal Exchange Nigeria Plc ·         Standard Alliance Group ·         eTranzact International Plc ·         Bank of Industry Limited ·         Lafarge WAPCO Cement Plc ·         Fidson Health Care Plc', 'No information disclosed', 'ACCg, NCCG, IMCN, ICAN, ACA among others.', '[\"9\",\"9\",\"8\",\"7\",\"9\"]', '84', '67.2', '7.2727272727273', '74.472727272727', 'WINNER', '2023-09-28 23:54:38', '2023-10-15 01:35:21'),
(2, 95, 423, NULL, '5', '18.518518518519', 'Leading organizations are seeking advice to address some of their most complex challenges. By bringing different perspectives, sound judgment and extensive cross-border collaboration, KPMG professionals help to enable clients’ informed decision-making wherever they do business and no matter how far-reaching their operations. See examples from some of the most prominent organizations in the world.', 'Digital transformation, Financial crimes prevention, Corporate Social Responsibility and among others', 'Dangote, FG, FIRS and many more.', 'No information disclosed', 'ICAN, ACCA, ACCG, IMCN among others.', '[\"7\",\"8\",\"8\",\"9\",\"7\"]', '78', '62.4', '4.5454545454545', '66.945454545455', NULL, '2023-09-28 23:54:38', '2023-10-15 01:35:21'),
(3, 95, 428, NULL, '5', '18.518518518519', 'EY helps clients create long-term value for all stakeholders. Enabled by data and technology, our services and solutions provide trust through assurance and help clients transform, grow and operate. Services includes Financial consulting, Cybersecurity consulting, Risk management consulting, Transaction law consulting among others.', 'Digital transformation, Corporate social responsibility, E-Trainings', 'No information provided', 'No information disclosed', 'ICAN, ACCA, ACCG, IMCN, SRA(England &Wales), IAB among others.', '[\"7\",\"7\",\"7\",\"6\",\"7\"]', '68', '54.4', '4.5454545454545', '58.945454545455', NULL, '2023-09-28 23:54:38', '2023-10-15 01:35:21'),
(4, 95, 425, NULL, '4', '14.814814814815', 'Our clients come to PwC for innovative and imaginative solutions to help them meet the challenges they face and capitalise on the opportunities they have to build trust with – and deliver sustained outcomes for – their stakeholders. In Africa, we’re the largest provider of professional services with over 450 partners and over 10,000 people in 32 countries. This means that we’re able to provide our clients with seamless and consistent Assurance, Consulting and Risk Services, Tax and Legal Services and Deals, wherever they do business on the continent.', 'Strategy, Digital transformation, Corporate social responsibility among others.', 'No information provided', 'No information disclosed', 'ACCG, NCCG, IMCN, ICAN, ACA among others.', '[\"6\",\"6\",\"8\",\"8\",\"7\"]', '70', '56', '3.6363636363636', '59.636363636364', NULL, '2023-09-28 23:54:38', '2023-10-15 01:09:56'),
(5, 96, 431, NULL, '13', '46.428571428571', 'Founded in 2009, Jobberman started as a recruitment and job search platform but has grown into an all-encompassing career platform offering online career advice, personalised HR solutions for both individuals and institutions as well as training services for jobseekers. Jobberman Nigeria forms part of the investment portfolio of The African Talent Company.  In addition to our powerful mission of connecting talent to opportunities, there are lots of reasons to come partner with us in achieving success in your career.  More than 2 million people each year trust us to help them win at work, from professional advancement and skills-building to finding a job.', 'Trainings, Digital Transformation and Corporate social responsibility', 'First Bank, Royal Arts Academy, Covenant University, BABCOCK University, Terra Culture, JA Nigeria, APSA, LAGOS State Univeristy, LSETF, DECAGON, Side Hustle', '4.2/5', 'PACIFIC ACCESS LTD', '[\"9\",\"8\",\"7\",\"9\",\"6\"]', '78', '62.4', '9.2857142857143', '71.685714285714', '', '2023-09-28 23:54:54', '2023-10-15 01:34:17'),
(6, 96, 429, NULL, '10', '35.714285714286', 'Founded in 1992 & headquartered in Nigeria, pcl. is a leading business and management consulting firm, serving clients across Africa through offices in Lagos and Abuja. We are a leading provider of transformation, technology, and outsourcing services.  Our staff represents diverse professional disciplines, ranging from business strategy, transformation & change, digital, information technology and training. Our people are practitioners and professionals who combine in-depth consulting knowledge with leading industry experts - many having worked with leading international organisations and delivered successful outcomes across the public and private sectors.  Culture', 'Strategy, Digital Transformation and Corporate social responsibility,  Information technology and Training', 'Howard University, Net Dimensions, KMI Learning', '4.1', 'No Available Information', '[\"8\",\"9\",\"8\",\"8\",\"9\"]', '84', '67.2', '7.1428571428571', '74.342857142857', 'WINNER', '2023-09-28 23:54:54', '2023-10-15 01:34:17'),
(7, 96, 430, NULL, '4', '14.285714285714', 'https://workforcegroup.com/about-us/', 'Strategy, Digital Transformation and Corporate social responsibility', 'First Bank plc, Sahara Group, Secure ID Limited, Asharami Energy, Nigerian Breweries Plc, Technology, Telecoms, Oil & Gas, Financial Services, Third Sector, FMCG etc', '4.5', 'Association of Outsourcing Professionals of Nigeria, Human Capital Providers Association of Nigeria, Chartered Institute of Personnel Management of Nigeria', '[\"7\",\"7\",\"6\",\"6\",\"8\"]', '68', '54.4', '2.8571428571429', '57.257142857143', NULL, '2023-09-28 23:54:54', '2023-10-15 01:34:17'),
(8, 96, 432, NULL, '1', '3.5714285714286', 'https://www.viclawrence.com/about-us/', 'Learning, Training & Development, Recruitment & Selection, Outsourcing, Strategy & Business Support, Testing and Assessment and HR Solutions.', 'Oil & Gas, Banking & Finance, FMCG, Healthcare, Manufacturing and Government parastatals.', '4.0', 'No Available Information', '[\"4\",\"6\",\"4\",\"6\",\"8\"]', '56', '44.8', '0.71428571428571', '45.514285714286', NULL, '2023-09-28 23:54:54', '2023-10-15 01:34:17');
