(1, 94, 410, NULL, '15', '44.117647058824', 'https://efour-aaf.com/who-we-are.html         https://efour-aaf.com/what-we-do.html', 'E-learning, Technological know-how, AML software solutions among others', 'clients not disclosed', 'Not disclosed', 'NIgeria Bar Association, Risk management Association of Nigeria, Board of quality standards among others', '[\"9\",\"8\",\"5\",\"8\",\"7\"]', '74', '59.2', '11.111111111111', '70.311111111111', '', '2023-09-25 17:34:37', '2023-10-15 01:36:49'),
(2, 94, 420, NULL, '6', '17.647058823529', 'agos Business School (LBS) is the graduate business school of Pan-Atlantic University, owned by the Pan-Atlantic University Foundation (PAUF), a non-profit foundation registered in Nigeria. LBS was founded on inspirations from the teachings of St Josemaria Escrivá, the founder of Opus Dei. LBS offers academic programmes, executive programmes and short courses (customised to specific company needs, as well as open-enrolment courses) in management. Its offerings have been accredited globally and ranked among the best in Africa, as it systematically strives to improve the practice of management on the continent. The business school’s efforts have been recognised by several world-class accreditations and rankings.  Besides the quality bar set at world-standards, LBS programmes also stand out because of the emphasis on professional ethics and service to the community.  Education at LBS is comprehensive, drawing on the experiences of a multinational faculty and participants. Learning is participant-centred and uses the case study method. Activities hold on the school’s purpose-built facilities which serve more than 3,000 participants yearly from indigenous and multinational companies. These attest to the expert teaching, the relevance of the programmes and the overall benefits derived from attending.  LBS has a robust alumni association with more than 6,000 members. This asset base, as well as the close relationship with the corporate world, ensures that the programmes offered, as well as having international standards, also has local relevance.  Learning at LBS is based on a Christian conception of the dignity of man, of society and economic activity. The Prelature of Opus Dei, an institution of the Catholic Church, takes responsibility for guaranteeing that this vision underlies all teaching, publishing and research activities of the School.  LBS is a member of the Association of African Business Schools (AABS), the Global Business School Network (GBSN), the Principles for Responsible Management Education (PRME), AACSB International-The Association to Advance Collegiate Schools of Business and the Graduate Management Admission Council (GMAC), alongside 220 leading graduate business schools worldwide. GMAC is an organisation of leading graduate management schools in the world and the owner of the GMAT exam.  In recognition of the quality of Lagos Business School’s programmes and of being structured in line with global best practices, it has received several international accreditations. LBS is the first business school in West, East and Central Africa regions to be accredited by The Association of MBAs (AMBA). This puts LBS amongst the exclusive group of only 2% of business schools in 70 countries to achieve this accreditation. The Association to Advance Collegiate Schools of Business (AACSB) has also accredited LBS, the first institution to be so recognised in all of West Africa. LBS thus joined the league of less than 5% of business schools globally, to be accredited by AACSB in December 2016. This accreditation affirms Lagos Business School’s undeniable commitment, over the last 30 years, to world-class standards in teaching, learning, research, academic and professional management.  LBS has been ranked every year, since 2007 by the Financial Times of London, among the top global providers of open enrolment executive education and in custom executive education since 2015. The latter ranked number one in Africa on the 2020 Financial Times list. LBS’ MBA programmes have held Tier One positions on CEO Magazine’s Global MBA rankings for three consecutive years. The School is listed among the top 50 global business schools on The Economist magazine’s 2018 Executive MBA ranking.', 'Virtual/E-learning, Software learning apps, self paced learning and many more', 'Not disclosed', '3.92 https://ng.indeed.com/cmp/Lagos-Business-School/reviews', 'Association of MBAs Accredited, Prime, AABS, AACSB Accredited, Graduate Management Admission council and many more.', '[\"6\",\"10\",\"8\",\"9\",\"9\"]', '84', '67.2', '4.4444444444444', '71.644444444444', 'WINNER', '2023-09-25 17:34:37', '2023-10-20 01:06:59'),
(3, 94, 422, NULL, '3', '8.8235294117647', 'AGRC is a place for knowledge-exchange, professional networking and idea incubation.  The Governance, Risk and Compliance (GRC) requirements are evolving at a pace that makes it challenging for professionals to follow and manage all aspects of this complex ecosystem.  Our vision is to connect the GRC community, enabling professionals and organisations to operate successfully and with integrity in a reliable and forward-looking way within a regulated environment. We envision a GRC sector that is more welcoming and appealing for new professionals.  Our values mark who we are as a global professional organisation. They define the way we collaborate and engage with our members, partners and civil society at large.  We are strong advocates of innovation. Sharing our knowledge and best practices whilst building on our experience and expertise, we are devoted to bringing together governance, risk and compliance with disruptive sectors such as cybersecurity, fintech, artificial intelligence (AI), big data and blockchain.  Our certification programs aim to raise the standards of ethics and integrity in the world of compliance, governance and risk, whilst boosting our industry’s knowledge and understanding of new technologies.  These programs cover a wide range of topics including  governance, risk management and compliance, all delivered by accredited training centres.  We also provide a platform where professionals can network and share ideas with fellow colleagues from all over the world. By exchanging ideas and know-how, we identify trends and seek solutions. Being part of our GRC community gives you the opportunity to interact with like-minded professionals who strive for innovation and forward-thinking ideas.  In a rapidly evolving international environment, we pride ourselves in our flexibility to meet the changing market requirements and trends. To this end, AGRC addresses the global community, uniting members from Europe, Africa, North and South America, Oceania and Asia.  AGRC members are recognised for their commitment to best GRC practices and their enhanced integrity. Our membership provides you with a variety of tools and resources that will enhance your career.', 'AI incline learning, Self paced learning, E-learning and Application software usage', 'Not disclosed', 'Not disclosed', 'Vespia, Ground Truth Intelligence, LexisNexis, YouControl, Investment Academy (Saudi Arabia),  London Governance & Compliance Academy (United Kingdom),  European Institute of Management & Finance (Cyprus, Greece, Ireland and Dubai),  Instituto de Prevenção e Combate à Lavagem de Dinheiro e ao Financiamento ao Terrorismo (Brazil),  BeyondComply (Lebanon)  RegTech Africa (Nigeria)  The Morgans Consortium (Nigeria)  Real CGR (Belgium)  Etikamente (Dominican Republic)  Leadership Institute for Administrators SA (South Africa),  Compliance Professionals (UK)  FinCrime Prevention Agent (UK)  MPI Learning (UK)  First Intuition Learning Solutions (UK)', '[\"4\",\"7\",\"7\",\"6\",\"8\"]', '64', '51.2', '2.2222222222222', '53.422222222222', NULL, '2023-09-25 17:34:37', '2023-10-15 01:36:49'),
(4, 94, 414, NULL, '3', '8.8235294117647', 'Capacity for Africa is a renowned ICT and soft skills training and strategy implementation consultancy company. We have built a solid reputation in the training industry by providing comprehensive training solutions across a wide range of competency domains. As a leading corporate training courses provider, we cover a wide range of courses for various public and private sector industries, government agencies, and non-governmental organizations across Africa and particularly in Nigeria including Aviation, Energy, Manufacturing, Construction, and Financial Services.', 'Virtual/E-learning, Software learning apps, self paced learning, ICT and many more', 'Opemipo Akin-Williams (Senior Accountant @ Silverbird communications), Ziade Rugarama (Finance Experts @Riwanda Airport company ltd, Kigali, Rwanda)', 'Not disclosed', 'undisclosed', '[\"4\",\"6\",\"5\",\"6\",\"7\"]', '56', '44.8', '2.2222222222222', '47.022222222222', NULL, '2023-09-25 17:34:37', '2023-10-15 01:36:49');
INSERT INTO `judges` (`id`, `name`, `email`, `password`, `position`, `path_to_image`, `profile`, `award_program_id`, `fb_link`, `ig_link`, `ln_link`, `created_at`, `updated_at`, `admin_id`) VALUES
(2, 'OluFemi Mosaku-Johnson', 'Jfemi950@gmail.com', '$2y$10$soPu9bxTf.vwASmjThk1O.ajgUU2Osj7uoUFXYTneBIsZBT8q.pte', 'Registrar/CEO - ACGPN', 'https://res.cloudinary.com/the-morgans-consortium/image/upload/v1664121843/grcfincrimeawards/judges/DR_Olufemi_Mosaku_-_picture_yplqlr.jpg', 'He is a graduate of Public Administration and has Masters in Personnel Psychology (UNAD, PhD organization leadership. He is a Chartered Secretary and Administrator, a Chartered Management Practitioner, Chartered Personnel Management Practitioner and Chartered Economist, Certified Business Sustainability Practitioner, CIPE Certified Anti-Corruption Practitioner, and IFC Certified Board Evaluator. A Member of the Nigerian Institute of Management (NIM), Chartered Institute of Personnel Management (CIPM) and Nigerian Institute of Training & Development (NITAD). He is a Fellow of the Association of Corporate Governance Professionals of Nigeria and Fellow of the Chartered Institute of Economist of Nigeria. He is a recognised leader in Corporate Governance in Nigeria and implementation of project governance and Strategy for organization with over 29 years of specialist experience in Insurance, Governance, Project Management, Consulting/Professional services, culminating in a successful tenure for ten years in Law Union & Rock Insurance Plc, eight years in Lagos State Public Service Staff Dev. Centre, five years at the Institute of Management (NIM). \r\n                He subsequently moved to the Institute of Directors\' (IoD), Nigeria where he pioneered and led the Directors’ Development Department with triple A rated directors learning in Nigeria and in the United Kingdom. \r\n                He is a member of the Board of trustees and secretary of the International Aeronautics College. \r\n                Secretary to the Board, Medical Ethics and Governance Initiatives, Board Member, Foundation for Value Transformation. Committee Member, Lagos State Post Service Welfare Council. Technical Consultant to Lagos Chamber of Commerce and Industry as well as Examiner at the Chartered Institute of Bankers. \r\n                He is an IFC Certified Corporate Governance Board Leadership Trainer, South Africa and CMD Accredited Trainer. \r\n                He is an alumnus of the Lagos Business School, LBS School of Media Communication, HIIT, CMD, IFC, NCEMA, Harvard Associates, FITC, Nepad South Africa, ACGN, South Africa, and is now focused on Board Evaluation, Project Governance and Business Performance using lean methodologies. Also using project governance tools to establish the strategic alignment between all processes, from all business units, at all levels. He is a published author and happily married with children.', 2, NULL, NULL, 'https://ng.linkedin.com/in/femi-mosaku-johnson-aa99769b', NULL, '2023-10-09 21:01:49', 8),
(3, 'Chii Ndubueze', 'chinenye23@yahoo.com', '$2y$10$Y5/ntXcisDZSEkjw2Q03y.TO5SAtECy3nQGxS2kIR4j1X2k05tYQa', 'Lawyer', 'https://res.cloudinary.com/the-morgans-consortium/image/upload/v1664121843/grcfincrimeawards/judges/chii_ndubueze_ph51ib.jpg', 'Experienced Lawyer with a demonstrated law practice history. Specialized in Cyber-crime, E commerce and Telecommunication Law, practice and research. Strong legal professional graduated from University of Hertfordshire and University of Portsmouth.', 2, NULL, NULL, 'https://www.linkedin.com/in/chii-ndubeze-37551a44/', NULL, '2023-10-15 20:52:33', 9),
(4, 'Kenneth Oguzie', 'kenneth.oguzie@activafr.com', '$2y$10$bzgGxHzSDBrRuxJ66VJG7uC5zxU6wc/oAPVmTrgZhlFytqqGbOmUW', 's CEO - ACTIV', 'https://res.cloudinary.com/the-morgans-consortium/image/upload/v1664121844/grcfincrimeawards/judges/kenneth_oguzie_e32wbr.jpg', 'Kenneth Oguzie is an International Trade Specialist and the CEO of Africa Canada Trade and Investment Venture (ACTIV), an organization which promotes international Trade and business between Canada and West Africa, both within private sector as well as creating public sector collaborations. He is also the Vice President of the Development of Ocean Technical Capacity with African Nations (DOTCAN)- a Canada-West Africa initiative that promotes Ocean Technology capacity building between Canada and West Africa through the pillars of Education and Training, Ocean Business Development and Entrepreneurship and Maritime Security. Born in Nigeria, Ken considers himself a global citizen having lived in Asia, Europe, Africa and presently North America. A prominent member of the Nigerian community and a recent recipient of the distinguished Nigerian in Nova Scotia award for his contribution to the West African community, he was recently awarded one of topmost inspiring immigrants in the Maritimes. Ken sits on multiple boards and commitees such as the Halifax local immigrant partnership, accessing skilled force committee of the Halifax chambers of commerce, Welcome to Canada Halifax Immigration museum (Pier21) ambassador, ISANS employer advisory council, Diversity, and Inclusion Standing Advisory Committee of the Nova Scotia College of Pharmacists etc.', 2, NULL, NULL, 'https://ca.linkedin.com/in/kenneth-oguzie-91b7638', NULL, '2023-10-10 16:43:45', 19),
(5, 'Adefunke Fola \nOyinloye\n(MILR, MCIPM, MNIM)', 'fola.oyinloye@gmail.com', '$2y$10$4ORp.6VAIRcfxZQnOOB.jeNjIZAvTFnvgulJdymr1AugsEs/1Qs4a', 'Registrar - Landmark University', 'https://res.cloudinary.com/the-morgans-consortium/image/upload/v1664121843/grcfincrimeawards/judges/fola_funke_xqbfav.jpg', 'Mrs Fola is an experienced University Administrator, with proven track record in General Administration, Team Building, Effective Communication, Public Speaking, Policy Writing, Customer Relations, Mentoring, Counseling, Crisis Management and Strategic Analytical Skills. I drive myself to birth change, having no patience with the status quo or mediocrity; and I push others to see and maximize their potentials, to birth change. Every challenge that I encounter on my assignment is an opportunity to demystify impossibility, and develop capacity for bigger assignments. I am objective, optimistic and decisive. A team lover, I believe strongly in the power of many in achieving robust and collaborative successes. I am committed to my given tasks, and strives for result delivery.', 2, NULL, NULL, 'https://www.linkedin.com/in/fola-funke-oyinloye-milr-mcipm-mnim-419a2299', NULL, '2023-10-09 21:03:25', 10),
(6, 'Gbubemi Atimomo (SHRM- SCP, SPHRi)', 'oritsegbubemi@yahoo.com', '$2y$10$xWwlU5CwbFGuuIIEGKTmFu13pZlYBSGS5UxQdDDz.3yOCiQBiwusW', 'HR & Business Consultant - Tandem Limited', 'https://res.cloudinary.com/the-morgans-consortium/image/upload/v1664121843/grcfincrimeawards/judges/gbubemi_atimomo_uvxxyu.jpg', 'Gbubemi Atimomo SHRM- SCP, SPHRi, is a passionate enterprise developer and consultant. He has vast experience in consulting and general human resources management. His expertise includes: identifying organizational issues, proposing solutions and working with stakeholders to achieve results.  His area of specialization includes; Consulting, Enterprise Development, Human Resource Strategy, Coaching, Career Advisory, People Development, Organisational Development, Creative Industries, Social Entrepreneurship, and Entrepreneurship.', 2, NULL, NULL, 'https://ng.linkedin.com/in/oritsega', NULL, '2023-10-09 21:03:40', 11),
(7, 'Olufemi Falola', '', '', 'Audit Executive & Finance Expert', 'https://res.cloudinary.com/the-morgans-consortium/image/upload/v1664121844/grcfincrimeawards/judges/femi_falola_zzxsvv.jpg', 'Olufemi Falola is a Chartered Accountant, with over 24 years post qualification experience, most of which was spent as a career in the foremost Firm of Chartered Accountants, Akintola Williams Deloitte where he became a Partner in 2003 and moved on in January, 2009.\n                Olufemi holds a Higher National Diploma in Accountancy (Upper Credit) from the Federal Polytechnic, Ilaro (1991). He is a Fellow of the Institute of Chartered Accountants of Nigeria (ICAN) and an Associate of Chartered Institute of Taxation of Nigeria (CITN). Olufemi, who is an Associate member of the Association of Certified Fraud Examiners (ACFE) is also a member of the Institute of Internal Auditors (IIA). He holds the prestigious Master of Business Administration (MBA) Degree from Manchester Business School, University of Manchester, UK. A Certified SAP R3 FI/CO Consultant from SAP Partner Academy, Johannesburg, South Africa, Olufemi has also participated in a number of top leadership development programmes, including the customized Pathways Leadership Programme delivered by Cranfield School of Management in conjunction with Lagos Business School (LBS).\n                Olufemi joined Akintola Williams Deloitte in 1993, where he possessed 16 years of Auditing and Accountancy business experience and exposure, which included 6 years as a Partner. Through hard work, dedication, professional competence and integrity, amongst other qualities, he rose to the position of a Partner effective 1 June, 2003 after 10 years of employment in the professional service firm and at the age of 36, a record achievement by the local Deloitte firm’s standard. Femi started in Deloitte as Audit Trainee (fresh graduate) and became Senior Manager within a record 7 years after qualifying as a Chartered Accountant within 2 years of writing the qualifying examinations, while working with Deloitte. He participated dynamically in developing Deloitte to its enviable leading position in the league of professional service firms not only in Nigeria but in West and Central Africa. \n                Olufemi has extensive auditing experience in the following industries: Banking and Insurance, Manufacturing/Consumer business, Oil and Gas and Service Providers including Telecommunication. His other specialist experiences include over 4 years experience as Engagement Partner in charge of outsourced Internal Audit functions. \n                Also while in Deloitte, Olufemi was the Partner saddled with the oversight responsibility for the Information Technology function of the entire Deloitte West and Central Africa for 5 years (2003 – 2008). He also doubled as the Firm’s Chief Finance Officer (CFO) for 17 months from January 2007 till May 2008.\n                Upon leaving Deloitte as a Partner in January 2009, Femi co-established Rehoboth Professional Services before making a foray into the industry to broaden his experience and expand his horizon by joining Bemil Nigeria Limited as the Chief Operating Officer (COO), a position he occupied from July 2009 till October, 2011. \n                In between his regular duties at Bemil, Olufemi consults for the World Bank in the area of Financial Management of World Bank projects.\n                In October, 2011, Femi joined Etisalat Nigeria as the Director, Internal Audit, a newly created position within the Company at that time. This role afforded Femi the opportunity to build the internal audit function in a rapidly growing Company from the ground up while initially focusing on developing methodology, creating an audit universe, conducting a risk assessment and developing and executing the annual risk-based internal audit plan. \n                Olufemi is a perfectionist; a thorough and meticulous person. He is known to be very passionate about his work, emotional, reserved but dogged. \n                In the course of business assignments and quest for knowledge, Olufemi has had the privilege of travelling extensively for training programs, seminars, business meetings and on vacation to several countries in Africa, Europe and America.', 2, NULL, NULL, 'https://www.linkedin.com/in/olufemi-falola-35626333/', NULL, NULL, NULL),
(12, 'Temitope Yusuff', 'topsydayz@yahoo.com', '$2y$10$MtcAFPoj./E8DlXETIipG.KupvLotMNYRRalReo5m2AgwUokjb.ee', 'Business and Finance Leader', 'https://res.cloudinary.com/the-morgans-consortium/image/upload/v1664121845/grcfincrimeawards/judges/temitope_yusuff_dnhwzg.jpg', 'Temitope Yusuff is a seasoned Business Leader and Finance professional, with over eighteen years of financial experience, with exposure to both local and international organizations. Her varied experience in providing core business transformation, strategy, auditing, risk management and corporate governance services provided me with a well-rounded perspective necessary to meet the needs business and financial needs of organizations. \r\n\r\nCurrently, She serve as the Director of Internal Audit and Risk Management of one of the largest telecommunications infrastructure providers globally and her work involves providing strategic leadership and direction in the planning, execution, and management of risk management and internal audit activities across IHS Africa (Nigeria, Cameroon, Cote d’Ivoire, Zambia, Rwanda, and South Africa). She leads the organization across a variety of global operational standards, which enables them to make efficient sound financial decisions, in line with global practices.\r\n\r\nI am a fellow of the Institute of Chartered Accountants(ICAN) and the Chartered Institute of Taxation of Nigeria (CITN), an Alumna of IESE Spain, with an MBA from the Lagos business school.\r\n\r\nAs a consummate Business professional, she possess a drive to create and implement robust solutions that bring about sustainable impact, transforming the businesses of professionals and business owners.', 2, NULL, NULL, 'https://www.linkedin.com/in/temitope-yusuff-86b41b57/', NULL, '2023-10-09 21:04:06', 15),
(13, 'Olumide Ajayi', 'omoakin.ajayi@yahoo.com', '$2y$10$SygKQlLuVM891tcbPU.Xwulh.Fwj0jD6gBs/iCYrBZ766FCC.7HEq', 'Senior KYC Consultant', 'https://res.cloudinary.com/the-morgans-consortium/image/upload/v1664121845/grcfincrimeawards/judges/olu_ajayi_gpwlo3.jpg', 'Olumide is a conscientious professional, well-rounded, results-oriented, thorough with an excellent track record extensive experience in Regulatory Compliance, AML/KYC, Project Management and Business Analysis worked in the financial and non-bank financial sector. \r\n\r\nHe has demonstrable quality and productivity expertise with proven skills in effective leadership, coaching, and mentoring. He has participated in the implementation of Banking Application projects, including new products, services, and upgrades to banking application platforms. He is confident that my wealth of experience built on my academic training, knowledge and understanding of the systems, processes and conduct risk has given me the skills required to work effectively in the Financial Service space.', 2, NULL, NULL, 'https://www.linkedin.com/in/olu-ajayi-12b81965/', NULL, '2023-10-10 16:44:37', 20),
(15, 'Emmanuel Michael (SPHRi)', 'enmichael@gmail.com', '$2y$10$g6bSzxWBHaTnrcdjvSPLnOSH5BczL.RAwPAT8iTkLVxmRPUtDBjvi', 'Founder - HRwithEM', 'https://res.cloudinary.com/the-morgans-consortium/image/upload/v1664121844/grcfincrimeawards/judges/en_micheal_ugyrwz.jpg', 'Emmanuel Michael (EM), a Leadership and Career Success Coach is a seasoned and highly sought-after multiple award-winning strategic business leader with over 2 decades of management experience spanning various industry verticals, such as multidisciplinary engineering, information technology, hospitality and financial services, of which over 18 years have been in human resources management practice. \r\n\r\nBetween March and August 2017, he held forth as the Interim CEO & Head of HR at Letshego MFB, a national microfinance bank in Nigeria. He is currently the Head of People & Culture at Letshego Nigeria. \r\n\r\nHe serves as a subject matter expert (SME) with the CIPM (Nigeria) and HRCI (USA) in addition to his role as a member of the HRCI Certification Council.\r\n\r\nHis contribution to the global HR community has resulted in several honours, among which are: 100 Most Influential Global HR Leaders (2018), 101 Global HR Heroes (2019), Top-rated Influencer on The Most Inclusive HR Influencer List by @socialmicole (2019), Top 50 Personalities on LinkedIn in Nigeria (2019), 501 Most Fabulous Global HR Leaders (2020), Top 8 HR Thought Leader in Africa (2020), Top 3 Best Revenue Supporting HR (2020), 30 Top Black HR Influencers to Follow (2020) and Top 50 Career Influencer in Africa (2020), Top 11 HR Leaders To Follow (2021), 40 HR Leaders and Innovators in Nigeria to Follow (2022), 122 Top CHROs (2022), and Top 200 Biggest Voices in Leadership (2022).\r\n\r\nEmmanuel is also the Founder & Host of #HRwithEM - a platform to #Connect, #Learn, and #Share on everything Leadership, Career Development, and Employee Experience.  He is fondly called \"The HR Celebrity\" by the Nigerian HR community.', 2, NULL, NULL, 'https://www.linkedin.com/in/enmichael/', NULL, '2023-10-09 21:04:21', 12),
(17, 'Bola Segun-Peter', 'bkaezy@gmail.com', '$2y$10$5piGNtZ8uHiIh9a9W/GFj.GMsuld09Ub3EvJYFW7ae7avqbRY7y/S', 'Associate Member - NIM & RIMAN', 'https://res.cloudinary.com/the-morgans-consortium/image/upload/v1664121844/grcfincrimeawards/judges/bola_segun_lmcik6.jpg', 'Bola Segun-Peter holds Bachelors and Masters Degrees in Economics and an MBA in Management from the Lagos Business School. \r\n                She has over 2 decades of banking experience with extensive hands-on experience in Credit Risk Management cutting across top Nigerian banks and up till January 2019, she was Assistant General Manager/Head of Credit Administration in Ecobank Nigeria Ltd. Bola has passion for change management and interest in personal finance as she strongly believes that being financially independent is key to financial freedom. \r\n                Bola is an Associate Member of the Nigerian Institute of Management (Chartered) and Risk Managers’ Association of Nigeria (RIMAN). She is currently involved in School Safety implementation project in schools in Lagos State.\r\n                \r\n                She presently runs her own business which includes Consulting, Micro lending & advisory services, Insurance Agency, Perfumery and trading in & distribution of FMCGs.  She is an avid lover of sports particularly Football, Tennis & F1. \r\n                \r\n                Bola is happily married with children.', 2, NULL, NULL, '', NULL, '2023-10-09 21:04:37', 13),
(18, 'Adedayo Adeyemi', 'dayadeyemi@yahoo.com', '$2y$10$40VtHGcg65BIYPbYkcHCvu8aOPuJBGGKE4UZMm93YleDMu/uQBEgu', 'Barrister', 'https://res.cloudinary.com/the-morgans-consortium/image/upload/v1664121844/grcfincrimeawards/judges/adedayo_adeyemi_yjbnxy.jpg', 'Bar. Adedayo Adeyemi has over 30 years post graduate experience. He holds a bachelor degree in Social Sciences from University of Ife now Obafemi Awolowo University, Ile-Ife and a Law degree from the University of Lagos. \r\n\r\n                He crossed to the banking sector in 1991 from the broadcasting sector. He served in the General Administration department of the Fountain Trust Bank Plc, as well as the Human Resources department and Credit Administration Department of the Bank. \r\n                \r\n                Bar. Adeyemi’s legal expertise enhanced his career focus as a disciplined control person devoid of bias in analyzing risks in credit related issues. This has been made possible with the assistance of relevant courses to position him as a risk manager. His short stay in the Legal Dept of Fountain Trust Bank coupled with a wide range of credit background facilitated his continued stay in the Debt Recovery and Classified Assets Management Group of the Bank as a Manager till the eve of banking consolidation in December, 2005. \r\n                \r\n                With the absorption of Fountain Trust Bank into the Spring Bank Plc coupled with his experience as a remedial management manager, Bar Adeyemi was charged with the responsibility of heading the External Recoveries Unit of the Remedial Asset Management Group III of the Bank till September, 2008. In April, 2008, He was promoted to the level of a Senior Manager where he supervised the Remedial Assets Management Group of Spring Bank Plc till it metamorphosized into Enterprise Bank Limited. He left Enterprise Bank on 14th February, 2012. \r\n                \r\n                Bar. Adeyemi has been in full legal practice till date.', 2, NULL, NULL, 'https://www.linkedin.com/in/dayo-adeyemi-b6271830/', NULL, '2023-10-16 20:05:25', 14),
(19, 'Esosa Balogun (BSc, FCA, CCSA, CRMA, CIA, MBA)', 'esosa.balogun@gmail.com', '$2y$10$x4j0dkb5fHgbJUJGZyWjLO8LJ.XDDWslyJwOEJnRGVjFVeBWiKWqC', 'General Manager, Risk Mgt. at MTN Nigeria', 'https://res.cloudinary.com/the-morgans-consortium/image/upload/v1664121846/grcfincrimeawards/judges/esosa_balogun_rblaiu.jpg', 'Esosa is a seasoned professional with extensive experience in the areas of Enterprise Risk Management, Internal Audit, Internal Control, Compliance and Corporate Governance. She is currently the General Manager, Risk Management in the Risk and Compliance Division of MTN Nigeria Communications Plc. Prior to joining MTN; she was the Head, Risk and Compliance for the UAC Group and Senior Manager, Risk Consulting at KPMG Nigeria. She possesses an in-depth understanding of the Nigerian business environment having led engagements across various industries including manufacturing, oil and gas, telecommunications and ﬁnancial services industries. She holds a Master in Business Administration (MBA) from Edinburgh Business School, United Kingdom and a Bachelor of Science in Accounting from the University of Benin. She is a Fellow of the Institute of Chartered Accountants of Nigeria (ICAN), a member of The Institute of Internal Auditors (IIA) as well as the Institute of Directors (IoD). She has obtained certifications in Risk Management Assurance (CRMA), Internal Audit (CIA), and in Control Self- Assessment (CCSA) from the IIA Global. Esosa was Non-Executive Director and Chairperson of Portland Paints & Products Nigeria Plc (2019 -2021). She is a lover of God and a stoic supporter of leadership and growth for women.', 2, NULL, NULL, 'https://www.linkedin.com/in/esosa-balogun', NULL, '2023-10-09 21:09:11', 18);
